import { StudentClass } from './types/Student';

type StudentPropType={
    student:StudentClass
}

//export default function Student({student}:{student: StudentClass}) {
    export default function StudentDate({student}:StudentPropType) : React.ReactElement{
        const formattedDate = student.dataUrodzenia.toLocaleDateString('en-US', {
            year: 'numeric',
            month: 'long',
            day: 'numeric',
          });
  
  return (
    
    <>
    
     Date of birth:   {formattedDate}  &nbsp; 
    </>
  );
}
